import React from 'react';
import { Navbar, Nav, Link, Image} from 'react-bootstrap';

export default function Navibar()
{
    return(
        <Navbar collapseOnSelect expand="lg" bg="dark" variant ="dark">
            <Navbar.Brand>eSupport </Navbar.Brand>
            <Navbar.Toggle aria-controls ="responsive-navbar-nav"/>
            <Navbar.Collapse id ="responsive-navbar-nav">
                <Nav className = "mr-auto"> 
                    <Nav.Link href="#home">Home</Nav.Link>
                    <Nav.Link href="#registration-form">Registration</Nav.Link>
                    <Nav.Link href="#log-in-form">Log in</Nav.Link>
                </Nav>
                <Nav>
                    <Image id="img" href = "" src="/R.jpg" width="50" height="50" circle = "true"/>
                </Nav>
            </Navbar.Collapse>
        </Navbar>   
    );
}
